                #{deptId}





            AND CALL_USER_ID IN

                #{userId}





    AND CALL_USER_ID = #{param.userId}


    AND TARGET_TYPE = #{param.targetType}


    AND CALL_TIME >= #{param.time1}


    AND CALL_TIME <= #{param.time2}

